    "codigo": "<!-- Comment Form -->\n<div class=\"max-w-[85rem] px-4 py-10 sm:px-6 lg:px-8 lg:py-14 mx-auto\">\n  <div class=\"mx-auto max-w-2xl\">\n    <div class=\"text-center\">\n      <h2 class=\"text-xl text-gray-800 font-bold sm:text-3xl dark:text-white\">Post a comment</h2>\n    </div>\n\n    <!-- Card -->\n    <div\n      class=\"\n        mt-5\n        p-4\n        relative\n        z-10\n        bg-white\n        border\n        rounded-xl\n        sm:mt-10\n        md:p-10\n        dark:bg-gray-800\n        dark:border-gray-700\n      \"\n    >\n      <form>\n        <div class=\"mb-4 sm:mb-8\">\n          <label\n            for=\"hs-feedback-post-comment-name-1\"\n            class=\"block mb-2 text-sm font-medium dark:text-white\"\n            >Full name</label\n          >\n          <input\n            type=\"text\"\n            id=\"hs-feedback-post-comment-name-1\"\n            class=\"\n              py-3\n              px-4\n              block\n              w-full\n              border-gray-200\n              rounded-md\n              text-sm\n              focus:border-blue-500\n              focus:ring-blue-500\n              sm:p-4\n              dark:bg-gray-800\n              dark:border-gray-700\n              dark:text-gray-400\n            \"\n            placeholder=\"Full name\"\n          />\n        </div>\n\n        <div class=\"mb-4 sm:mb-8\">\n          <label\n            for=\"hs-feedback-post-comment-email-1\"\n            class=\"block mb-2 text-sm font-medium dark:text-white\"\n            >Email address</label\n          >\n          <input\n            type=\"email\"\n            id=\"hs-feedback-post-comment-email-1\"\n            class=\"\n              py-3\n              px-4\n              block\n              w-full\n              border-gray-200\n              rounded-md\n              text-sm\n              focus:border-blue-500\n              focus:ring-blue-500\n              sm:p-4\n              dark:bg-gray-800\n              dark:border-gray-700\n              dark:text-gray-400\n            \"\n            placeholder=\"Email address\"\n          />\n        </div>\n\n        <div>\n          <label\n            for=\"hs-feedback-post-comment-textarea-1\"\n            class=\"block mb-2 text-sm font-medium dark:text-white\"\n            >Comment</label\n          >\n          <div class=\"mt-1\">\n            <textarea\n              id=\"hs-feedback-post-comment-textarea-1\"\n              name=\"hs-feedback-post-comment-textarea-1\"\n              rows=\"3\"\n              class=\"\n                py-3\n                px-4\n                block\n                w-full\n                border-gray-200\n                rounded-md\n                text-sm\n                focus:border-blue-500\n                focus:ring-blue-500\n                sm:p-4\n                dark:bg-gray-800\n                dark:border-gray-700\n                dark:text-gray-400\n              \"\n              placeholder=\"Leave your comment here...\"\n            ></textarea>\n          </div>\n        </div>\n\n        <div class=\"mt-6 grid\">\n          <button\n            type=\"submit\"\n            class=\"\n              py-3\n              px-4\n              inline-flex\n              justify-center\n              items-center\n              gap-2\n              rounded-md\n              border border-transparent\n              font-semibold\n              bg-blue-500\n              text-white\n              hover:bg-blue-600\n              focus:outline-none\n              focus:ring-2 focus:ring-blue-500 focus:ring-offset-2\n              transition-all\n              dark:focus:ring-offset-gray-800\n            \"\n          >\n            Submit\n          </button>\n        </div>\n      </form>\n    </div>\n    <!-- End Card -->\n  </div>\n</div>\n<!-- End Comment Form -->\n"
